Ext.define('Registropersona.view.registropersona.Edit', {
    extend: 'Ext.window.Window',
    alias: 'widget.edit_persona',
    layout: {
        type: 'vbox',
        align: 'stretch'
    },
    modal: true,
    resizable: false,
    closeAction: 'hide',
    width: 750,
    DEFAULT_IMAGE: 'data:image/jpg;base64,',
    initComponent: function() {
        var me = this;
        this.items = [
            {
                xtype: 'form',
                itemId: 'basic_data',
                region: 'center',
                margins: '5 5 5 5',
                fieldDefaults: {
                    labelAlign: 'top',
                    msgTarget: 'side',
                    anchor: '100%',
                    labelWidth: 70
                },
                frame: true,
                border: false,
                bodyPadding: '5 5 0',
                layout: {
                    type: 'vbox',
                    align: 'stretch'
                },
                items: [
                    {
                        xtype: 'hidden',
                        name: 'idpersona'
                    }, {
                        xtype: 'hidden',
                        name: 'iddocidentidad'
                    },
                    {
                        xtype: 'container',
                        layout: {
                            type: 'hbox',
                            align: 'stretch'
                        },
                        items: [
                            {
                                xtype: 'container',
                                anchor: '100%',
                                layout: 'vbox',
                                margins: '0 10 0 0',
                                items: [
                                    {
                                        xtype: 'image',
                                        name: 'foto',
                                        width: 140,
                                        height: 140,
                                        style: {
                                            cursor: 'pointer',
                                            border: '1px solid #5FA2DD'
                                        },
                                        src: this.DEFAULT_IMAGE,
                                        listeners: {
                                            click: {
                                                element: 'el',
                                                fn: function() {
                                                    Ext.get('uploadFoto').dom.click();
                                                }
                                            }
                                        }
                                    }
                                ]
                            },
                            {
                                xtype: 'container',
                                flex: 1,
                                layout: 'anchor',
                                items: [
                                    {
                                        xtype: 'fieldcontainer',
                                        layout: 'hbox',
                                        defaultType: 'textfield',
                                        anchor: '100%',
                                        items: [
                                            {
                                                name: 'nombre',
                                                fieldLabel: 'Nombre',
                                                width: 200,
                                                maxLength: 255,
                                                margins: '0 5 0 0',
                                                allowBlank: false
                                            },
                                            {
                                                flex: 1,
                                                name: 'apellidos',
                                                fieldLabel: 'Apellidos',
                                                maxLength: 255,
                                                allowBlank: false
                                            }
                                        ]
                                    },
                                    {
                                        xtype: 'fieldcontainer',
                                        layout: 'hbox',
                                        defaultType: 'textfield',
                                        anchor: '100%',
                                        items: [
                                            {
                                                xtype: 'combobox',
                                                name: 'idcategoriadocidentidad',
                                                fieldLabel: 'Tipo documento',
                                                displayField: 'nombre',
                                                valueField: 'idcategoriadocidentidad',
                                                margins: '0 5 0 0',
                                                width: 200,
                                                allowBlank: false,
                                                typeAhead: true,
                                                queryMode: 'local',
                                                store: 'Categoriadoc'
                                            },
                                            {
                                                name: 'numeroidentidad',
                                                fieldLabel: 'No. identidad',
                                                maxLength: 255,
                                                margins: '0 5 0 0',
                                                allowBlank: false,
                                                width: 120
                                            },
                                            {
                                                xtype: 'combobox',
                                                name: 'sexo',
                                                fieldLabel: 'Sexo',
                                                displayField: 'sexo',
                                                valueField: 'id',
                                                margins: '0 5 0 0',
                                                width: 90,
                                                allowBlank: false,
                                                typeAhead: true,
                                                queryMode: 'local',
                                                forceSelection: true,
                                                store: Ext.create('Ext.data.Store', {
                                                    fields: ['id', 'sexo'],
                                                    data: [
                                                        {id: 0, sexo: 'Femenino'},
                                                        {id: 1, sexo: 'Masculino'}
                                                    ]
                                                })
                                            },
                                            {
                                                flex: 1,
                                                xtype: 'combobox',
                                                name: 'estadocivil',
                                                fieldLabel: 'Estado civil',
                                                displayField: 'denominacion',
                                                valueField: 'id',
                                                width: 100,
                                                allowBlank: false,
                                                typeAhead: true,
                                                queryMode: 'local',
                                                forceSelection: true,
                                                store: Ext.create('Ext.data.Store', {
                                                    fields: ['id', 'denominacion'],
                                                    data: [
                                                        {id: 0, denominacion: 'Soltero'},
                                                        {id: 1, denominacion: 'Casado'},
                                                        {id: 2, denominacion: 'Viudo'}
                                                    ]
                                                })
                                            }
                                        ]
                                    },
                                    {
                                        xtype: 'fieldcontainer',
                                        layout: 'hbox',
                                        anchor: '100%',
                                        items: [
                                            {
                                                xtype: 'combobox',
                                                name: 'idnacionalidad',
                                                fieldLabel: 'Nacionalidad',
                                                displayField: 'nacionalidad',
                                                valueField: 'idpais',
                                                width: 200,
                                                allowBlank: false,
                                                forceSelection: true,
                                                editable: true,
                                                typeAhead: true,
                                                queryMode: 'local',
                                                store: 'Nacionalidad'
                                            }
                                        ]
                                    }
                                ]
                            }
                        ]
                    }
                ]
            }
        ];

        this.buttons = [
            {
                iconCls: 'fa fa-hand-o-right blue-button',
                text: '<b>Aplicar</b>',
                action: 'aplicar'
            }, {
                iconCls: 'fa fa-check-circle green-button',
                text: '<b>Aceptar</b>',
                action: 'aceptar'
            }, {
                iconCls: 'fa fa-times-circle red-button',
                text: '<b>Cancelar</b>',
                action: 'cancelar',
                scope: this,
                handler: this.close
            }
        ];

        this.callParent(arguments);

        Ext.get('uploadFoto').on('change', function(f, value, opt) {
            var file = f.target.files[0];
            var reader = new FileReader();
            reader.onload = function(evt) {
                var fileData = evt.target.result;
                var bytes = new Uint8Array(fileData);
                var base64Img = Base64.encodeByteArray(bytes);
                me.down('image[name=foto]').setSrc('data:image/jpg;base64,' + base64Img);
            };
            reader.readAsArrayBuffer(file);
        });
    }
});